import React, { Component } from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import './slider.scss';
import { SlImg, LandE } from './components';
import { NavLink } from 'react-router-dom';

export default class Lima extends Component {
	render() {
		var settings = {
			dots: true,
			fade: true,
			infinite: true,
			speed: 500,
			autoplay: false,
			slidesToShow: 1,
			slidesToScroll: 1,
			className: 'slides',
			arrows: true,
		};
		return (
			<section className="w-70 w-100-m center ">
				<NavLink to="/progetti" className="link ">
					<Slider {...settings}>
						<LandE
							to="https://www.ideascudo.com/homepage/"
							container=""
							article="dim bg-light-gray"
							background="./img/ideascudo/ideascudo_1.png"
							title="Ideascudo"
							group="logo"
						/>
						<SlImg src="./img/lima/3.png" />
						<SlImg src="./img/lima/1.png" />
						<SlImg src="./img/lima/2.png" />
					</Slider>
				</NavLink>

			</section>
		);
	}
}



